import styled from "styled-components";
export const Wrapper = styled.div`
	position: relative;
`;

export const TypeWriterWrapper = styled.div`
	width: 100%;
	height: 100%;
	display: flex;
	flex-direction: column;
	justify-content: center;
	position: absolute;
	z-index: 1;
`;
